using System;

namespace Rabani.DistinctProducts.Web.Extensions
{
    public static class BytesExtenstions
    {
        public static string BinaryToBase64String(this byte[] bytes)
        {
            string empty = "";
            if (bytes == null)
                return empty;
            if (bytes.Length == 0)
                return empty;
            return Convert.ToBase64String(bytes);
        }
    }
}